async fn create_and_start_program(account_init_bytes: Vec<u8>, final_exp_bytes_pubkey: Pubkey, nullifier_pubkey: Pubkey, program_id: Pubkey) -> ProgramTestContext {

    let mut program_test = ProgramTest::new(
        "Testing_Hardcoded_Params_devnet_new",
        program_id,
        processor!(process_instruction),
    );
    let merkle_tree_pubkey = Pubkey::new(&MERKLE_TREE_ACC_BYTES);

    let mut account_exp = Account::new(10000000000, 3900, &program_id);
    account_exp.data = account_init_bytes;
    program_test.add_account(
        final_exp_bytes_pubkey,
        account_exp,
    );
    program_test.add_account(
        merkle_tree_pubkey,
        Account::new(10000000000, 16657, &program_id),
    );

    program_test.add_account(
        nullifier_pubkey,
        Account::new(10000000000, 2, &program_id),
    );

    let tmp = program_test.start_with_context().await;
    tmp

}

#[tokio::test]
async fn test_nullifier_correct()-> Result<(), TransportError> {
    let program_id = Pubkey::from_str("TransferLamports111111111111111111111111111").unwrap();

    let final_exp_bytes_pubkey = Pubkey::new_unique();

    let mut final_exp_data = FinalExpBytes::new();
    final_exp_data.current_instruction_index = 700;

    let mut final_exp_data_slice = [0u8; 3900];
    <FinalExpBytes as Pack>::pack_into_slice(&final_exp_data, &mut final_exp_data_slice);
    println!("init bytes: {:?}", final_exp_data_slice);
    let example_nullifier = mt_onchain_test::get_poseidon_ref_hash(&[1;32], &[2;32]);
    let hash = <Fq as FromBytes>::read(&example_nullifier[..]).unwrap();
    let nullifier_pubkey = Pubkey::create_with_seed(
        &program_id,
        &(hash).to_string()[0..15],
        &program_id
    ).unwrap();

    let mut program_context = create_and_start_program(final_exp_data_slice.to_vec(), final_exp_bytes_pubkey, nullifier_pubkey, program_id).await;

    let init_data = program_context.banks_client
        .get_account(final_exp_bytes_pubkey)
        .await
        .expect("get_account").unwrap();
    assert_eq!(init_data.data, final_exp_data_slice);

    let mut transaction = Transaction::new_with_payer(
        &[Instruction::new_with_bincode(
            program_id,
            &[vec![0, 2u8],example_nullifier.to_vec(), usize::to_le_bytes(0).to_vec()].concat(),
            vec![
                AccountMeta::new(program_context.payer.pubkey(),true),
                AccountMeta::new(final_exp_bytes_pubkey, false),
                AccountMeta::new(nullifier_pubkey, false),
            ],
        )],
        Some(&program_context.payer.pubkey()),
    );
    transaction.sign(&[&program_context.payer], program_context.last_blockhash);

    let res_request = program_context.banks_client.process_transaction(transaction).await;
    assert!(!res_request.is_err());

    let nullifier_account = program_context.banks_client
        .get_account(nullifier_pubkey)
        .await
        .expect("get_account").unwrap();

    assert_eq!([1,3], nullifier_account.data[0..2]);

    //try nullifier again

    let mut transaction = Transaction::new_with_payer(
        &[Instruction::new_with_bincode(
            program_id,
            &[vec![0, 3u8],example_nullifier.to_vec(), usize::to_le_bytes(1).to_vec()].concat(),
            vec![
                AccountMeta::new(program_context.payer.pubkey(),true),
                AccountMeta::new(nullifier_pubkey, false),
                //AccountMeta::new(merkle_tree_pubkey, false),
            ],
        )],
        Some(&program_context.payer.pubkey()),
    );
    transaction.sign(&[&program_context.payer], program_context.last_blockhash);

    let res_request = program_context.banks_client.process_transaction(transaction).await;
    println!("res_request {:?}", res_request.is_err());



    Ok(())
}
